insert  into `products`(`id`,`product_name`,`price`,`description`,`product_rate`,`stock`,`weight`,`created_at`,`updated_at`,`slug`,`deleted_at`) values (13,'Oversized Hoodie',899900,'Hoodie jumbo dari katun jersey organik yang tebal dengan motif bunga di bagian belakang dan logo desainer dibordir di bagian depan. Tudung berlapis ganda dengan lubang logam dan tali serut, bahu menurun, lengan panjang, dan kelim yang sedikit mengembang dengan saku samar di jahitan sampingnya. Tepi berusuk di manset dan kelim.',5,15,200,'2021-05-21 21:11:59','2021-05-27 15:05:56','oversized-hoodie','2021-05-27 15:05:56'),(14,'Corduroy Shirt Regular Fit',399900,'Shirt in cotton corduroy with a button-down collar, classic front and yoke at the back. Open chest pocket and long sleeves with adjustable buttoning at the cuffs and a sleeve placket with a link button. Rounded hem. Regular Fit – a classic fit with good room for movement and a gently tapered waist to create a comfortable, tailored silhouette.',5,31,226,'2021-05-08 23:18:15','2021-05-08 15:18:15','corduroy-shirt-regular-fit-1','2021-05-08 15:18:15'),(15,'Bomber Jacket',499900,'Bomber jacket in woven fabric with a ribbed stand-up collar and zip down the front. Zipped chest pocket, pockets in the side seams, an inner pocket with a press-stud, and ribbing at the cuffs and hem. Lined.',5,38,300,'2021-05-08 23:17:24','2021-05-08 15:17:24','bomber-jacket','2021-05-08 15:17:24'),(18,'Printed T-shirt',129900,'T-shirt in soft cotton jersey with a round neckline and a print motif.',5,28,200,'2021-05-12 20:43:27','2021-05-12 12:43:27','printed-t-shirt-1','2021-05-12 12:43:27'),(28,'Printed T-shirt',6500,'test',5,53,148,'2021-05-08 23:18:06','2021-05-08 15:18:06','printed-t-shirt-1','2021-05-08 15:18:06'),(29,'Printed T-shirt',6500,'test',5,53,148,'2021-05-08 23:18:03','2021-05-08 15:18:03','printed-t-shirt-2','2021-05-08 15:18:03'),(30,'compass gazelle',399000,'test',0,37,3000,'2021-05-08 23:18:01','2021-05-08 15:18:01','compass-gazelle','2021-05-08 15:18:01'),(31,'patrobas black white',399000,'test',0,30,87,'2021-05-08 23:17:57','2021-05-08 15:17:57','patrobas-black-white','2021-05-08 15:17:57'),(32,'Black Bomber Jacket',499900,'jaket bomber',0,12,300,'2021-05-19 23:42:42','2021-05-27 14:56:11','black-bomber-jacket','2021-05-27 14:56:11'),(33,'Printed T-shirt',0,'test',0,6,100,'2021-05-14 07:59:36','2021-05-13 23:59:36','printed-t-shirt','2021-05-13 23:59:36'),(34,'Nike Air Jordan 1 Dior',80000000,'test',0,2,2000,'2021-05-14 07:53:56','2021-05-13 23:53:56','nike-air-jordan-1-dior-1','2021-05-13 23:53:56'),(35,'Cotton Chinos Skinny Fit',399900,'Celana panjang chino dari katun kepar stretch dengan golbi ritsleting dan kancing, saku samping diagonal dan saku bobok belakang dengan kancing. Skinny Fit – model kaki sedikit lebih pendek dimana bagian paha, lutut, dan pergelangan kaki ketat untuk menciptakan siluet yang pas.',2.25,18,200,'2021-05-21 21:21:46','2021-06-01 02:15:58','cotton-chinos-skinny-fit',NULL),(36,'Hi-top Trainers',599900,'Hi-tops in imitation leather with imitation suede details. Padded top edge and tongue, lacing at the front and eyelets at the sides. Linings and insoles in mesh made from recycled polyester. Rubber soles with a patterned underneath. Height of soles 3 cm.',0,50,500,'2021-05-20 22:43:28','2021-05-27 14:57:45','hi-top-trainers','2021-05-27 14:57:45'),(37,'Skinny Coated Jeans',599900,'CONSCIOUS Jean 5 saku berbahan denim stretch yang dapat dicuci terbuat dari campuran liosel Tencel ™ dengan pinggang biasa, bolgi ritsleting dan kancing, serta kaki yang kurus. Kandungan poliester pada celana jeans ini adalah hasil daur ulang.',0,50,200,'2021-05-26 04:33:34','2021-05-27 15:09:32','skinny-coated-jeans','2021-05-27 15:09:32'),(38,'Baju Ganteng',350000,'Baju hype beast',NULL,12,100,'2021-05-26 08:04:29','2021-05-26 08:06:00','baju-ganteng','2021-05-26 08:06:00');

